      '$t': 'Breed: Pit Bull Terrier Mix Description: Willow Sparkles is a beautiful white dog with a couple brown spots, and assorted black and pink smudges. She has the biggest, softest ears that perk up when she is happy. Personality: Willow Sparkles is a very happy dog and eager to please. She loves going on walks and does very well on the leash, nicely greeting people and other dogs. She would love a backyard to run around because she still has a lot of puppy energy. After we get back to the house from our walks, Willow will curl up on the couch and cuddle with her person. Willow is very gentle with kids, but gets very excited around other dogs and needs a slow introduction. She is quite affectionate and would love to be the center of attention as the only dog. AND she is house trained, crate-trained and does well riding in the car! We are also working on manners such as sit, stay and come and she is a quick study. Willow is food and people motivated so she is easy to train. She will make a great addition to an active household that is ready to welcome a sweet,loving girl into their hearts. Animal History: Willow Sparkles was brought to IAR from a rural shelter.'
