    'description': {
      '$t': 'Breed: Labrador Retriever Mix Description: BeeBee is black with four white paws and a little bit of white on her chest. She is tall and slender with long legs. Her ears stand half-way up and she has very pretty brown eyes. Personality: How can I write a profile about BeeBee without it sounding over the top? She has so many good qualities! She is fun-loving, affectionate, not to mention gorgeous. And caring to the point that when she met a young puppy whose broken leg is in a cast, she showered her with motherly tenderness and concern. Beebee is such a good listener that she quickly learns new information. I can say one word and she is right there, trying to figure out what I want from her. When walking her, if she pulls a bit, I just get her attention by saying her name, and she stops, turns around and circles back to me, standing by my side. Just say crate and she walks into her crate! An energetic and vocal playmate, BeeBee loves to play with other dogs. She is looking for a loving household where her capacity for love will be welcomed. Your life will definitely benefit from the addition of this dark and beautiful package of light and devotion. Animal History: We have known BeeBee since she was born, as her mother was brought into our program pregnant. We remember the playful puppy she was, and can still see that puppy today. Due to unforeseen circumstances, she has ended up back with us.'
    },
