    'description': {
      '$t': "Breed: Australian Shepherd / Border Collie Mix Description: Willa is black, white, and tan with floppy ears, and white under her chin and down the front of her neck. Although she has no tail, she wags her little stump. Personality: Willa is a sweet, happy dog! Shes still young, so she has a lot of energy and a lot of growing up to do. It has been said about Willa that she has a zest for life and that she's up for anything! She's been hiking at the Eno and Duke Forest, she's explored Northgate park in Durham and Orange park in Hillsborough, she's even kept her foster parents company at Fullsteam while they had lunch! She is a smart, fast learner, although she can easily get excited. She does best when she gets plenty of exercise during the daya couple long walks, playtime with other doggie friends, or time out in a fenced yard to run around. She loves chasing after a frisbee, a tennis ball, or anything that you can throwand she will retrieve! Willa also enjoys navigating agility obstacles including tunnels; jumping through a hanging tire; jumping over hurdles; and running up, over, and down platforms. Sometimes she runs up the platform ramp with so much enthusiasm that she slides across the top, rolls over the side, then springs right back up ready to go again! Shes food motivated, so giving her treats helps with training and getting her attention when she's distracted. She loves working her nose to find treats that are hidden! One of the adorable things Willa does is that if a treat falls in her water bowl, she will stick her snout in the water and blow bubbles like a little tugboat until she gets the treat out! Willa would be a great partner for anyone interested in enrolling a dog in agility training or nose work classes. Her foster home is the first home she has ever known. When she is in the house, Willa is on a schedule of time in the crate and time out for exercise and training. She goes into the crate easily, since there's always a couple of Kongs filled with yummy frozen treats waiting for her! And that's where she eats her breakfast and dinner. Willa sleeps through the night in her crate. She is taken outside often through the day, and has not had any accidents in the house.When Willa sees the neighbor's dog through a fence, she is able to be directed with treats to sit and watch quietly. If she gets too close to something really interesting, she is likely to pull on the leash and jump. These are things her foster parents have been working with her on to help her learn how to calmly meet new people and animals.Anyone interested in adopting Willa will need the confidence to work with a high-energy dog, patience, and the time and energy to commit to helping this wonderful dog to reach her full potential. To get a better sense of how great Willa is, check out the videos below. Animal History: Willa was found as a stray and spent several months at a local shelter. While at the shelter, the volunteers spent time working with her, teaching her some basic skills, socializing her in playgroups, and even teaching her to navigate a couple of agility obstacles."
    },
