    'description': {
      '$t': 'Breed: Pit Bull Terrier Mix Description: Hugo is so beautiful, with gorgeous, very soft blue (gray/silver) fur and white accents. He has the sweetest eyes, and his big face--complete with adorable jowls, freckles, and a couple little pink spots--will make you smile. His body is naturally long and slender. Personality: Hugo is a wonderful, very well-behaved gentleman. He is house trained and crate trained. When left alone, he does not engage in any destructive behavior in the house. He goes quietly in his crate and will rest after adjusting his position to make sure he is nice and cozy.He walks really well on a leash and does not pull; he does not require a halter, but we use one, as that is more comfy for him. Hugo needs to be the only treasured dog in the home. He is a very low-key, quiet guy who really loves to be with his people. He will sit or lie on the floor next to you while you cook, work, and watch TV; and his favorite thing is leaning on you so he can bury his big, soft head into your lap. He will offer to give you kisses. Hugo does not pay any mind to dogs while walking, even when they bark at him. However, if given the opportunity, he loves to say hello with a polite little sniff. He loves his walks, and especially enjoys snuffling the grass with his lovely big nose, and generally exploring the big world around him. Animal History: Hugo came from another rescue that is no longer in existence.'
    },
