      '$t': 'Macon is a male hairless Chinese Crested being fostered in North Carolina. He is an adorable little guy with red furnishings and a strong, stout, sturdy build. He almost looks like he might have some dachshund in him the way his body is shaped. He weighs about 16 pounds and was born in 2007. \nMacon is current on all vaccines, heartworm negative and neutered.\n\nMacon is the father of Milo who is also up for adoption. Although Macon and Milo have been together for quite some time, it is not necessary that they be adopted together. \n\nBefore Macon came into rescue, he was living outside!  He is now an indoor dog and loving it!  He has adjusted quite nicely to the house and is totally crate trained. He has not had any accidents inside, but is usually supervised when loose in the house.\nMacon is a very loving silly little guy who wants nothing more than to be loved. He is a totally laid back, low-energy dog once he integrates into the family. Macon is more of a followerânot a leader. He gets along well with other dogs and looks to other dogs for guidance.  When Macon is placed by himself, he becomes rather timid and unsure of himself.  He would do well in a household with another dog that could guide him. He does not walk too well on a leash if he is walking by himself, but, again, does much better when he can follow another dog.  I do not know how Macon behaves around children, but he would probably do ok with older children, but best with adults.\n\nHe will at times make sounds that I never heard come out of a dog and totally indescribable.  Quite unique indeed! He doesnât bark much but when he does, you will hear quite a hefty, hearty bark that will definitely warn you of anyone approaching. His red-headed temper rises up when strangers approach. He will bark quite protectively and needs to be strongly supervised when around new people until he adjusts to their presence.\n\nMacon loves his food and can be a bit snippy toward other dogs that come a little too close to his bowl. He does not have any food aggression toward people. Heâs not too fond of getting baths, but is learning to tolerate them.  He is quiet while riding in a car but tends to get motion sickness depending on the length of the ride. He is frightened by thunderstorms and wants to be close to his person for comfort during a storm.\n\nWhen Macon first arrived into foster care, he had a very high prey drive and could not be trusted around cats or other small animals.  I am very glad to say that he is overcoming his urge to go after the household cats quite nicely and the cats and he are learning to be in the same room at the same time without incidence.  I would, however, still not trust him alone with a cat or small animal without strict supervision.\n\nMacon is a wonderful little dog who would greatly benefit from individualized attention, training and love to bring out his full potential as a welcomed family member! He will repay you with loyalty and lots of love. \n\nIf you are interested in this cute little guy, please fill out the adoption application at http://www.crest-care.net/forms/form?formid=2201&contactsformsid=975981 \n\nIf you have any questions email crestcareinc@gmail.com\n\nThanks for considering a rescue dog!'
